A <a href="http://sw.opencyc.org/concept/Mx4rvViBApwpEbGdrcN5Y29ycA" class="cyc_term">BinaryPredicate</a> that relates an instance of <a href="http://sw.opencyc.org/concept/Mx4rvVii2ZwpEbGdrcN5Y29ycA" class="cyc_term">PersonTypeByOccupation</a> to a specialization of <a href="http://sw.opencyc.org/concept/Mx4rvhT1EZwpEbGdrcN5Y29ycA" class="cyc_term">Location_Underspecified</a>.  <code>(<a href="http://sw.opencyc.org/concept/Mx4rEWkDXtqNQdiOcOtPDsG_YA" class="cyc_term">agentTypeWorksAtLocationType</a> <b>AGT-TYPE</b> <b>LOC-TYPE</b>)</code> means that instances of <code><b>AGT-TYPE</b></code> typically perform a significant fraction of their work at instances of <code><b>LOC-TYPE</b></code>.  For example:

(<a href="http://sw.opencyc.org/concept/Mx4rEWkDXtqNQdiOcOtPDsG_YA" class="cyc_term">agentTypeWorksAtLocationType</a> <a href="http://sw.opencyc.org/concept/Mx4rvVjj1ZwpEbGdrcN5Y29ycA" class="cyc_term">Bartender</a> <a href="http://sw.opencyc.org/concept/Mx4rvVkHaZwpEbGdrcN5Y29ycA" class="cyc_term">BarRoomSpace</a>);
(<a href="http://sw.opencyc.org/concept/Mx4rEWkDXtqNQdiOcOtPDsG_YA" class="cyc_term">agentTypeWorksAtLocationType</a> <a href="http://sw.opencyc.org/concept/Mx4rvVkAUpwpEbGdrcN5Y29ycA" class="cyc_term">BusDriver</a> <a href="http://sw.opencyc.org/concept/Mx4rvVi0v5wpEbGdrcN5Y29ycA" class="cyc_term">Bus_RoadVehicle</a>;
(<a href="http://sw.opencyc.org/concept/Mx4rEWkDXtqNQdiOcOtPDsG_YA" class="cyc_term">agentTypeWorksAtLocationType</a> <a href="http://sw.opencyc.org/concept/Mx4rvVjrVZwpEbGdrcN5Y29ycA" class="cyc_term">Doctor_Medical</a> <a href="http://sw.opencyc.org/concept/Mx4raPZQYlsLEdaAAACQJ5pZBw" class="cyc_term">MedicalFacility</a>).

A <a href="http://sw.opencyc.org/concept/Mx4rvViBApwpEbGdrcN5Y29ycA" class="cyc_term">BinaryPredicate</a> and (typed) specialization of <a href="http://sw.opencyc.org/concept/Mx4rlVa_sss2EdqAAACQJw5drg" class="cyc_term">agentTypeUsesType</a> that relates a specialization of <a href="http://sw.opencyc.org/concept/Mx4rvVinb5wpEbGdrcN5Y29ycA" class="cyc_term">IntelligentAgent</a> to a specialization of <a href="http://sw.opencyc.org/concept/Mx4rvjSBSZwpEbGdrcN5Y29ycA" class="cyc_term">Artifact_Generic</a>.  <code>(<a href="http://sw.opencyc.org/concept/Mx4rKFYhYtd5QdiUeM-jRWV7Sg" class="cyc_term">agentTypeUsesArtifactType</a> <b>AGT-TYPE</b> <b>ART-TYPE</b>)</code> means that instances of <code><b>AGT-TYPE</b></code> frequently or typically use instances of <code><b>ART-TYPE</b></code>.  For example:
<pre>
  (<a href="http://sw.opencyc.org/concept/Mx4rKFYhYtd5QdiUeM-jRWV7Sg" class="cyc_term">agentTypeUsesArtifactType</a> <a href="http://sw.opencyc.org/concept/Mx4rvVjfgpwpEbGdrcN5Y29ycA" class="cyc_term">Dentist</a> <a href="http://sw.opencyc.org/concept/Mx4rvVjeIJwpEbGdrcN5Y29ycA" class="cyc_term">DentalDrill</a>) ;
  (<a href="http://sw.opencyc.org/concept/Mx4rKFYhYtd5QdiUeM-jRWV7Sg" class="cyc_term">agentTypeUsesArtifactType</a> <a href="http://sw.opencyc.org/concept/Mx4rvVjN-JwpEbGdrcN5Y29ycA" class="cyc_term">ComputerProgrammer</a> <a href="http://sw.opencyc.org/concept/Mx4rvVjXzZwpEbGdrcN5Y29ycA" class="cyc_term">Computer</a>) ;
  (<a href="http://sw.opencyc.org/concept/Mx4rKFYhYtd5QdiUeM-jRWV7Sg" class="cyc_term">agentTypeUsesArtifactType</a> <a href="http://sw.opencyc.org/concept/Mx4rvVkDQ5wpEbGdrcN5Y29ycA" class="cyc_term">Carpenter</a> <a href="http://sw.opencyc.org/concept/Mx4rvVjSApwpEbGdrcN5Y29ycA" class="cyc_term">Hammer</a>) .
